(280, 690, 'Thông tin thanh toán', 'thong-tin-thanh-toan', '<div><span style="font-size: 12pt;">Thông tin tài khoản người hưởng: LÊ THỊ HUYỀN</span></div>\r\n<div><span style="font-size: 12pt;"> </span></div>\r\n<div>1. BIDV- Ngân hàng thương mại cổ phần đầu tư và phát triển Việt Nam TK: 199.1000.179.634 – Chi nhánh Hồng Hà.</div>\r\n<div>2. Vietcombank- Ngân hàng thương mại cổ phần ngoại thương Việt Nam TK: 0491.0000.93.977- Chi nhánh Thăng Long</div>\r\n<div>3. Agribank- Ngân hàng phát triển nông nghiệp và nông thôn Việt Nam TK 15.0720.5730.850 – Chi Nhánh Cầu Giầy</div>\r\n<div>4. Viettin bank: Ngân hàng thương mại cổ phần Công Thương Việt Nam TK: 108.866.705.158 - CHI NHÁNH TÂY HÀ NỘI</div>\r\n<div> </div>\r\n<div>\r\n<p><span style="font-size: 12pt;">- Bất kỳ tài khoản nào không được cập nhật ở trên đều không có giá trị thanh toán.</span></p>\r\n<p><span style="font-size: 12pt;"> * Để phản ánh về chất lượng dịch vụ quý khách vui lòng liên hệ:  Ms Huyền 0989.262.956</span></p>\r\n<p> </p>\r\n<p class="header" style="text-align: center;"><strong><span style="font-size: 12pt;"><a href="http://quangchaukids.com/" rel="alternate">http://quangchaukids.com/</a> </span></strong></p>\r\n</div>', '', 1, 2, '2014-07-22 09:46:52', 457, 'Tỏ Nguyễn', '2017-03-17 07:00:45', 459, 0, '0000-00-00 00:00:00', '2014-07-22 09:46:52', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","info_block_show_title":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 19, 6, 'Thông tin thanh toán tainghe365.com', 'Thông tin thanh toán Tainghe365 cung cấp các sản phẩm tai nghe,máy nghe nhạc,loa di động,amp dac chính hãng với giá rẻ nhất, chế độ bảo hành tốt nhất– Click để biết mức giá hót nhất, free ship trong nội thành', 1, 246, '{"robots":"","author":"T\\u1ecf Nguy\\u1ec5n","rights":"","xreference":""}', 0, '*', 'Thông tin thanh toán tainghe365.com'),
(282, 696, 'Chính sách Vận Chuyển ', 'chinh-sach-van-chuyen', '<div><strong><span style="font-size: 12pt;"><a title="TAINGHE365" href="http://tainghe365.com/" rel="alternate">TAINGHE365</a> GIAO HÀNG TẬN NHÀ VÀ CHUYỂN PHÁT TOÀN QUỐC</span></strong></div>\r\n<div><span style="font-size: 12pt;"> </span></div>\r\n<div><span style="text-decoration: underline;"><em><span style="font-size: 12pt;">Đối với khách hàng ở khu vực Hà nội:</span></em></span></div>\r\n<div><span style="font-size: 12pt;"> </span></div>\r\n<div><span style="font-size: 12pt;">- Trường hợp giao hàng trực tiếp: Khách hàng vui lòng tham khảo kĩ sản phẩm mình định lấy. Giao hàng tận nhà vui lòng cộng thêm từ 10k đến 30k tiền ship tùy từng khu vực. </span></div>\r\n<div><span style="font-size: 12pt;">- Trường hợp giao hàng qua chuyển phát nhanh: Trường hợp này áp dụng đối với khách hàng ở Hà nội nhưng đi lại không thuận tiện như ở Gia lâm, Sóc Sơn, Đông anh, Sơn tây, Ba vì... Khách hàng chuyển khoản vào tài khoản ngân hàng của chúng tôi, sau đó chúng tôi sẽ gửi hàng qua chuyển phát nhanh đến tận nơi theo yêu cầu của khách hàng</span></div>\r\n<div><span style="font-size: 12pt;">- Vui lòng liên hệ trực tiếp với chúng tôi để có thông tin tốt hơn.</span></div>\r\n<div> </div>\r\n<div><span style="text-decoration: underline;"><em><span style="font-size: 12pt;">Đối với khách hàng không ở khu vực Hà nội:</span></em></span></div>\r\n<div> </div>\r\n<div><span style="font-size: 12pt;">- Khách hàng vui lòng tìm hiểu kĩ về sản phẩm mình định đặt hàng. Sau đó chuyển tiền trước cho chúng tôi qua tài khoản ngân hàng (cước phí chuyển phát nhanh chúng tôi áp dụng là 30k đối với toàn bộ đơn hàng, một số trường hợp chúng tôi sẽ hỗ trợ vận chuyển miễn phí) .</span></div>\r\n<p><span style="font-size: 12pt;">Sau khi tiếp nhận đơn hàng, nhân viên giao hàng <strong>tainghe365</strong> sẽ giao hàng đến địa chỉ do khách hàng cung cấp. Tại thời điểm giao hàng, khách hàng kiểm tra đơn hàng theo hóa đơn (số lượng, số tiền). Khách hàng vui lòng thanh toán bằng tiền mặt hoặc chuyển khoản. Việc giao hàng kết thúc khi khách hàng xác nhận đủ đơn hàng.</span></p>\r\n<div><span style="font-size: 12pt;">- Quý khách lưu ý khi chuyển khoản vui lòng điền tên và nội dung mặt hàng cần mua để chúng tôi có thể xử lý đơn hàng được nhanh nhất.</span></div>\r\n<div><span style="font-size: 12pt;">- Sau khi chuyển khoản xong quý khách nhắn tin, gọi điện đến số Hotline 01649.629.629 hoặc gửi mail tới tainghe365@gmail.com để thông báo và cung cấp đầy đủ thông tin số điện thoại, địa chỉ người nhận hàng để chúng tôi có có thể gửi hàng cho quý khách được nhanh nhất.</span></div>\r\n<div><span style="font-size: 12pt;">- Sau đó chúng tôi sẽ có trách nhiệm chuyển hàng cho quý khách qua các dịch vụ chuyển phát nhanh uy tín như: EMS, Tín thành, viettel, 247, </span></div>\r\n<div><span style="font-size: 12pt;">- Thời gian nhận hàng của quý khách từ 24h-48h tùy từng khu vực.</span></div>\r\n<p><strong><span style="font-size: 12pt;">* Lưu ý:</span></strong></p>\r\n<p><span style="font-size: 12pt;"> - Thời gian giao hàng có thể nhanh hơn hoặc lâu hơn với dự kiến vì lý do thời tiết, đơn hàng tại cửa hàng hiện quá tải, địa chỉ do khách hàng cung cấp bị nhầm lẫn với các địa chỉ khác. Lúc này, <strong>tainghe365</strong> sẽ thông báo cụ thể đến khách hàng ngay khi phát sinh sự kiện gây chậm trễ việc giao hàng.</span></p>\r\n<p><span style="font-size: 12pt;"> - Trường hợp khách hàng thay đổi địa chỉ hoặc yêu cầu điều chỉnh đơn hàng chỉ được thực hiện trong vòng 15 phút từ khi xác nhận đơn hàng và địa chỉ giao hàng.</span></p>\r\n<p><span style="font-size: 12pt;"> - Việc điều chỉnh đơn hàng sẽ không được chấp nhận nếu khách hàng thông báo điều chỉnh sau 15 phút kể từ khi đơn hàng đã được <strong>tainghe365</strong> tiếp nhận.</span></p>\r\n<p><span style="font-size: 12pt;">- Dịch vụ giao hàng tận nơi được thực hiện từ <strong>10h30 sáng tới 08h30 tối</strong> tất cả các ngày trong tuần.</span></p>\r\n<p><span style="font-size: 12pt;">* Để phản ánh về chất lượng dịch vụ quý khách vui lòng liên hệ:  Mr Sáng 01656.121.095</span></p>', '', 1, 2, '2014-07-22 09:48:56', 457, '', '2016-01-09 16:14:49', 457, 0, '0000-00-00 00:00:00', '2014-07-22 09:48:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 17, 3, '', '', 1, 247, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
