(10055, 'vina_veneno', 'template', 'vina_veneno', '', 0, 1, 1, 0, '{"name":"vina_veneno","type":"template","creationDate":"July 2014","author":"vinagecko.com","copyright":"Copyright (coffee) 2015 VinaGecko.com. All rights reserved.","authorEmail":"support@vinagecko.com","authorUrl":"http:\\/\\/VinaGecko.com","version":"1.3","description":"\\n\\t\\t\\n\\t\\t\\t<p>Vina Veneno - Multipurpose Responsive Joomla 3.x Template<\\/p>\\n\\t\\t\\t<p>Vina Veneno is multipurpose responsive Joomla 3.x Template powered by Joomla 3.x and JoomShopping ecommerce component - most easy to use Online Shop for Joomla. This template is bright and simple with 3 stores and 1 business layout which make you have many choices for your online store or portfolio\\/company website. That will be a great solution for online sport shop, fashion store, accessories or any other kind of products.<\\/p>\\n\\t\\t\\t<p>Aside from just looking beautifully polished and clean, it comes packed with features and options, powerful Helix II Framework, 4 Home Page layout, 9 popular Joomla 3.x Extensions from VinaGecko.com: Vina Camera Image Slider, Vina Article Carousel, Vina Product Carousel for JShopping, Vina Manufacturers Carousel for JShopping, Vina Product Ticker for JShopping, Vina Article Accordion, Vina Treeview for JShopping, Vina Vertical News Ticker and Vina Category Menu for JoomShopping. It''s easily configured various modules positions and a lot other best and selected extensions help you to develop your site in no time.<\\/p>\\n\\t\\t\\t<p>Vina Veneno comes with tons of shortcode such for video, gallery, slideshow, tabs, accordion, rich administration features such as logo settings, masterpiece layout builder, mega menu, unlimited fonts control, Google analytics, Less compilation and all types of presets control like header color, link color, background color so on. Now you don''t need to worry about its speed. The built-in css and javascript compresses used by Helix Framework to provide optimal performance.<\\/p>\\n\\t\\t\\t<p>If you''re searching a online store for selling furniture, phones, mobiles and accessories or any other kind of products, Vina Veneno template is a great choice for you!<\\/p>\\n\\t\\t\\t<h3>Main Features:<\\/h3>\\n\\t\\t\\t<ul class=\\"arrow\\">\\n\\t\\t\\t\\t<li> Responsive Design: This means that you only need one template for the desktop, iPad, iPhone and other mobile devices.<\\/li>\\n\\t\\t\\t\\t<li> 4 Home Page Layout: 3 beautiful home page for online shop, and 1 impression home page for fashion news\\/company.<\\/li>\\n\\t\\t\\t\\t<li> Fully Support JoomShopping component: JoomShopping is the most easy to use OnlineShop for Joomla. More than 200.000 new Users in 3 years! Vina Veneno is Fully Support it!<\\/li>\\n\\t\\t\\t\\t<li> Layout Builder: Allows anyone to customize the existing theme in any shape or dimensions without having any programming language!<\\/li>\\n\\t\\t\\t\\t<li> Mega Menu: allows you to display a ton of content in menu item including text, images, module and articles.<\\/li>\\n\\t\\t\\t\\t<li> Off-Canvas Menu: used primarily with Mobile and touch devices and can provide an extremely useful and beautiful experience for your users.<\\/li>\\n\\t\\t\\t\\t<li> Rich typography: Advanced Typography based on Bootstrap would enable you styling your Tables, Forms, and Buttons along with other elements to make your website more beautiful.<\\/li>\\n\\t\\t\\t\\t<li> Shortcode Support: Useful Shortcode installed by using which anybody can add lots of extra features on website without coding knowledge.<\\/li>\\n\\t\\t\\t\\t<li> RTL Language Support: Supports RTL (Right to Left) Language based Designs like Arabic, Farsi & Hebrew.<\\/li>\\n\\t\\t\\t\\t<li> HTML5 Base Template: We brought HTML5 in Our Templates to make elegant, modern and SEO friendly website that would be fully functional & represents awesome typography.<\\/li>\\n\\t\\t\\t\\t<li> Built With Less CSS: You can reduce over requests to browsers while making CSS development and it makes your whole website more powerful and speedier than ever.<\\/li>\\n\\t\\t\\t\\t<li> Use Helix Framework: Helix Framework is one of the best light and feature rich responsive framework for Joomla Templating.<\\/li>\\n\\t\\t\\t\\t<li> 9 Premium Extensions from VinaGecko: Vina Camera Image Slider, Vina Article Carousel, Vina Product Carousel for JShopping, Vina Manufacturers Carousel for JShopping, Vina Product Ticker for JShopping, Vina Article Accordion, Vina Treeview for JShopping, Vina Vertical News Ticker and Vina Category Menu for JoomShopping are the popular extensions for Joomla 3.x. Now you can use it in Vina Veneno template.<\\/li>\\n\\t\\t\\t\\t<li> Fully Support JComment component: JComments is a powerful and easy to use AJAX based comment system for Joomla. Vina Veneno is Fully Support it!<\\/li>\\n\\t\\t\\t\\t<li> CSS & Javascript Compression: Helix decreases your website loading time drastically by using Advanced CSS & JS compression systems that works with all types of browsers.<\\/li>\\n\\t\\t\\t\\t<li> Google Analytics: Users can easily integrate Google Analytics Code on their website and can maintain all the features that Google Analytics are providing.<\\/li>\\n\\t\\t\\t\\t<li> Pewered By BootStrap: Bootstrap is made upon responsive CSS Designs with less code which enhances the overall look of your website.<\\/li>\\n\\t\\t\\t<\\/ul>\\n\\t\\t\\t<strong>Note:<\\/strong> Demo images are not included in the quickstart package and have been replaced with placeholder images.\\n\\t\\t\\n\\t","group":"","filename":"templateDetails"}', '{"layout_width":"1170","layout_type":"responsive","logo_type":"image","logo_position":"logo","logo_type_text":"Helix","logo_type_slogan":"Joomla! Templates Framework","logo_width":"130","logo_height":"50","footer_position":"footer1","showcp":"1","copyright":"Copyright \\u00a9  {year} Shaper Helix - II Demo. All Rights Reserved.","show_helix_logo":"1","jcredit":"1","credit_link":"1","credit_text":"Designed by {JoomShaper}","validator":"0","showtop":"1","totop_position":"footer2","preset":"preset1","preset1_header":"#f8f8f8","preset1_bg":"#f2f2f2","preset1_text":"#666666","preset1_link":"#22b8f0","preset2_header":"#eeeeee","preset2_bg":"#f5f5f5","preset2_text":"#444444","preset2_link":"#6d7f1b","preset3_header":"#e5ddd5","preset3_bg":"#f2f2f2","preset3_text":"#333333","preset3_link":"#aa824a","menu":"mainmenu","menutype":"mega","menu_col_width":"200","show_menu_image":"1","menu_image_position":"1","submenu_position":"0","init_x":"0","init_y":"0","sub_x":"0","sub_y":"0","body_font":"","header_font":"","header_selectors":"","other_font":"","cache_time":"60","compress_css":"0","compress_js":"0","enable_ga":"0","ga_code":"","loadjquery":"0","loadfromcdn":"0","lessoption":"1","hide_component_area":"0","scroll_effect":"1","effect":"fadeInDown"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
