(10165, 'JUX Mega Menu Package', 'package', 'pkg_jux_megamenu', '', 0, 1, 1, 0, '{"name":"JUX Mega Menu Package","type":"package","creationDate":"September 2013","author":"JoomlaUX","copyright":"","authorEmail":"","authorUrl":"","version":"3.2.4","description":"\\n    \\n\\t\\t<style type=''text\\/css''>\\n\\t\\t\\t.jse_desc{\\n\\t\\t\\t\\ttext-align: left;\\n\\t\\t\\t}\\n\\t\\t<\\/style>\\n        <div class=''jse_desc''>\\n\\t\\t\\t<h2>JUX Mega Menu<\\/h2>\\n\\t\\t\\t<img alt=''JUX Mega Menu'' src=''http:\\/\\/www.joomlaux.com\\/images\\/zj_fileseller\\/images\\/JUX_Mega_Menu_Small.png'' \\/>\\n\\t\\t\\t<span><p>JUX Mega Menu is the most completed and easy to use Joomla menu module which allows you to display a ton of content in menu item including text, images, module and articles.\\n\\t\\t\\t\\t<\\/p><\\/span>\\n\\t\\t\\t<div>\\n\\t\\t\\t\\t<h4>Most completed Mega Menu<\\/h4>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li>JUX Mega Menu is fully<strong> responsive<\\/strong><\\/li>\\n\\t\\t\\t\\t\\t<li>Come with\\u00a0<strong><strong>horizontal <\\/strong><\\/strong>or\\u00a0<strong><strong>vertical <\\/strong><\\/strong>version<\\/li>\\n\\t\\t\\t\\t\\t<li><strong>Mobile &amp; Tablets compatible!<\\/strong><\\/li>\\n\\t\\t\\t\\t\\t<li><span>Available Joomla\\u2122 3.x<\\/span><\\/li>\\n\\t\\t\\t\\t\\t<li>Support for <strong>Pure CSS<\\/strong> (non-JavaScript) menus<\\/li>\\n\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t\\t<h4>Easy to use<\\/h4>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li>Works out of the box with most Joomla Templates<\\/li>\\n\\t\\t\\t\\t\\t<li><strong>No coding required!<\\/strong><\\/li>\\n\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t\\t<h4>Highly Customizable<\\/h4>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li><span>Includes <\\/span><strong>3 Themes and continue adding<\\/strong><\\/li>\\n\\t\\t\\t\\t\\t<li><span>Supports both <\\/span><strong>Slide and Fade Effects<\\/strong><span> for Sub Menus, or deactivate animations completely<\\/span><\\/li>\\n\\t\\t\\t\\t\\t<li><span>Choose fr