(1, 0, '', '0.00', 0, '', '2017-05-17 09:32:30', '2017-05-17 09:36:37', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE56C0T-IRP-2A.jpg', 0, 0, 3, 0.00, 0, 0, 17, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HD-TVI HIKVISION DS-2CE56C0T-IRP', 'hikvision-ds-2ce56c0t-irp', '- Cảm biến 1/3" CMOS Image Sensor \r\n- Độ phân giải 1.0 MP; 720p@25fps/720p@30fps \r\n- 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR \r\n- Ống kính 3.6mm, Angle of View: 70.9°(3.6mm) \r\n- Hồng ngoại lên tới 20 mét \r\n- Thiết kế vỏ nhựa lắp đặt phù hợp trong nhà', '<p><strong>Thông số camera HDTVI HIKVISION DS-2CE56C0T-IRP</strong><br />- Camera chất lõi nhựa, vỏ nhựa với thiết kế dễ lắp đặt và cân chỉnh hơn<br />- Cảm biến 1/3" CMOS Image Sensor<br />- Độ phân giải 1.0 MP<br />- Độ nhạy sáng 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR<br />- 3.6mm (2.8mm, 6mm optional), Angle of View: 70.9°(3.6mm), 92°(2.8mm), 56.7°(6mm)<br />- 12 Led, hồng ngoại thông minh Smart IR, tầm xa hồng ngoại 20m.<br />- Phù hợp lắp đặt trong nhà.<br />- Dải nhiệt hoạt động rộng (-40°~60°).<br />- Nguồn cấp 12VDC.</p>', '', '', '', '', '', '24 Tháng'),
(2, 0, '', '0.00', 0, '', '2017-05-17 09:39:59', '2017-05-17 09:56:32', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CD1301D-I.jpg', 0, 0, 3, 0.00, 0, 0, 11, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA IP HIKVISION DS-2CD1301D-I (1.0MP)', 'camera-ip-hikvision-ds-2cd1301d-i-1-0mp', ' Camera bán cầu, lắp đặt trong nhà \r\n- Cảm biến: 1/4" Progressive Scan CMOS \r\n- Độ phân giải 1.0 Megapixel \r\n- Ống kính 2,8mm/F2.0, Tầm xa hồng ngoại lên tới 10m \r\n- Hỗ trợ các tính năng chống ngược sáng DWDR, Chống nhiễu số 3D DNR, BLC.', '<p><strong>Thông số kỹ thuật camera IP Hikvision DS-2CD1301D-I</strong><br />- Camera bán cầu, lắp đặt trong nhà<br />- Cảm biến: 1/4" Progressive Scan CMOS<br />- Độ phân giải 1.0 Megapixel<br />- Độ phân giải ghi hình: 1280x720:25fps(P)/30fps(N)<br />- Hỗ trợ chuẩn nén H.264&amp;MJPEG<br />- Ống kính 2,8mm/F2.0 (tùy chọn ống kính khác 4/6/8/12mm)<br />​- Tầm xa hồng ngoại lên tới 10m. <br />- Cắt lọc hồng ngoại ICR<br />- Hỗ trợ các tính năng chống ngược sáng kỹ thuật số DWDR, Chống nhiễu số 3D DNR, BLC.<br />- Nguồn cấp: DC 12V<br />- Xuất xứ: Trung Quốc<br />- Bảo hành: 24 tháng</p>', '', '', '', '', '', '24 Tháng'),
(3, 0, '', '0.00', 0, '', '2017-05-17 09:55:21', '2017-05-17 09:56:22', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE56D0T-IT3.jpg', 0, 0, 3, 0.00, 0, 0, 8, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HDTVI HIKVISION DS-2CE56D0T-IT3 (2.0MP)', 'camera-hdtvi-hikvision-ds-2ce56d0t-it3-2-0mp', '- Camera bán cầu chuẩn HD phù hợp lắp đặt trong nhà \r\n- Cảm biến ảnh 2.0megapixel Progressive Scan CMOS \r\n- Độ phân giải 2MP: 1930(H)*1088(V) \r\n- Đèn hồng ngoại 2 bóng EXIR LEDs, tầm xa 40m \r\n- Chống nước tiêu chuẩn IP66', '<p><strong>Thông số camera HDTVI Hikvision DS-2CE56D0T-IT3</strong><br />- Cảm biến 2.0megapixel Progressive Scan CMOS.<br />- Độ phân giải 2.0megapixel<br />- Độ nhạy sáng 0.1Lux. <br />- Ống kính 3.6mm ( Đặt hàng: 6mm).<br />- Góc trông rộng (90 độ với ống kính 3.6mm, 55.4 độ với ống kính 6mm).<br /><strong>- Hồng ngoại thông minh 2 bóng EXIR LEDs, tầm xa 40m</strong><br />- Chống nước tiêu chuẩn IP66<br />- Bù ngược sáng (BLC), giảm nhiễu số ( DNR), Giảm nhiễu KTS<br />- Nguồn vào 12 VDC.<br />- Dải nhiệt hoạt động rộng (-40°~60°).<br /><strong>- Màu trắng</strong><br />- Chưa kèm adaptor<br />- Xuất xứ: Trung Quốc<br />- Bảo hành: 24 tháng</p>', '', '', '', '', '', '24 Tháng'),
(4, 0, '', '0.00', 0, '', '2017-05-17 10:02:29', '2017-05-17 10:02:29', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE16D0T-IRP.png', 0, 0, 3, 0.00, 0, 0, 14, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HDTVI HIKVISION DS-2CE16D0T-IRP (2.0MP)', 'camera-hdtvi-hikvision-ds-2ce16d0t-irp-2-0mp', '- Camera thân, vỏ nhựa, chuẩn HD phù hợp lắp đặt trong nhà & ngoài trời \r\n- Cảm biến ảnh 2.0megapixel Progressive Scan CMOS. \r\n- Độ phân giải 2MP: 1930(H)*1088(V). \r\n- Hồng ngoại thông minh Smart IR 24 Leds, tầm xa hồng ngoại 20m. \r\n- Chống nước tiêu chuẩn IP66. ', '<p><strong>Thông số camera HDTVI Hikvision DS-2CE16D0T-IRP</strong><br />- Cảm biến 2.0megapixel Progressive Scan CMOS.<br />- Độ phân giải 2.0megapixel<br />- Độ nhạy sáng 0.1Lux. <br />- Ống kính 3.6mm ( Đặt hàng: 6mm).<br />- Góc trông rộng (90 độ với ống kính 3.6mm, 55.4 độ với ống kính 6mm).<br />- Hồng ngoại thông minh Smart IR 24 Leds, tầm xa hồng ngoại 20m.<br />- Chống nước tiêu chuẩn IP66.<br />- Có menu OSD có thể điều khiển từ  xa qua cáp đồng trục.<br />- Tính năng : Chống rung (Anti-flicker).<br />- Bù ngược sáng (BLC), giảm nhiễu số ( DNR),<br />- Bắt chuyển động ( Motion detection),<br />- Mặt nạ che ( Privacy Mask).<br />- Nguồn vào 12 VDC.<br />- Dải nhiệt hoạt động rộng (-40°~60°).<br /><strong>- Màu trắng, dạng vỏ nhựa</strong><br />- Chưa kèm adaptor</p>', 'sua chua camera', 'sua chua camera quan sat, lap dat camera', 'camera hikvision', '', '', '24 Tháng'),
(5, 0, '', '0.00', 0, '', '2017-05-17 10:07:56', '2017-05-17 10:07:56', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CD2610F-IS.jpg', 0, 0, 3, 0.00, 0, 0, 11, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA IP HIKVISION DS-2CD2610F-IS', 'camera-ip-hồng-ngoại-hikvision-ds-2cd2610f-is', '- Camera thân 1.3MP ống kính thay đổi tiêu cự \r\n- Cảm biến: 1/3" Progressive Scan CMOS. \r\n- Độ phân giải 1280x960 \r\n- Chống ngược sáng tốt (DWDR) \r\n- Hỗ trợ chuẩn IP66 chống nước, chống thời tiết xấu. \r\n', '<p><strong>Thông số camera IP HIKVISION DS-2CD2610F-IS</strong><br />- Camera thân 1.3MP ống kính thay đổi tiêu cự<br />- Cảm biến 1.3 MP độ phân giải 1280x960<br />- Ống kính thay đổi tiêu cự vary-focal 2.8-12mm<br />- Tầm xa hồng ngoại đến 30m<br />- Chống nhiễu kĩ thuật số (3D DNR) &amp; Chống ngược sáng kĩ thuật số (DWDR) &amp; Bù sáng nền (BLC)<br />- Tiêu chuẩn ngoài trời IP66<br /><strong>- </strong>Thêm kết nối audio và báo động<br />- Dải nhiệt hoạt động rộng (-30°~60°).<br />- Nguồn cấp 12VDC.<br />- Xuất xứ: Trung Quốc<br />- Bảo hành: 24 tháng</p>', 'sua chua camera, lap dat camera', 'sua chua camera, lap dat camera, sua chua camera quan sat', 'sua chua camera, lap dat camera, sua chua camera quan sa', '', '', '24 Tháng'),
(6, 0, '', '0.00', 0, '', '2017-05-17 10:11:58', '2017-05-17 10:11:58', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE16C0T-IT3.png', 0, 0, 3, 0.00, 0, 0, 15, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT3', 'camera-hdtvi-hikvision-ds-2ce16c0t-it3', '- Camera thân HD720P lắp đặt trên tường, phù hợp lắp cho gia đình, văn phòng, shop ..... \r\n- Cảm biến: 1MP CMOS Image Sensor \r\n- Độ phân giải: 1.0 Megapixel. \r\n- Hồng ngoại: 40m, đèn hồng ngoại thông minh \r\n- Hỗ trợ DNR, tiêu chuẩn IP66', '<p><strong>Thông số kỹ thuật camera HDTVI HIKVISION DS-2CE16C0T-IT3</strong><br />- Cảm biến ảnh: 1MP CMOS Image Sensor<br />- Độ phân giải: 1.0 Megapixel<br />- Tỷ lệ khung hình: 720p@25fps/720p@30fps<br />- Truyền tín hiệu thời gian thực khoảng cách xa, tốc độ nhanh<br />- Độ nhạy sáng 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR<br />- Ống kính tiêu cự 3.6mm hoặc 6mm<br />- Tầm quan sát xa: 40m<br />- Hỗ trợ Day/Night(ICR), DNR<br />- Hỗ trợ tính năng hồng ngoại thông minh (Smart IR).<br />- Hỗ trợ IP66 chống thời tiết xấu<br />- Nguồn: DC12V </p>', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT3', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT3', 'sua chua camera, lap dat camera', '', '', '24 Tháng'),
(7, 0, '', '0.00', 0, '', '2017-05-17 10:14:38', '2017-05-17 10:14:38', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE16C0T-IT5.png', 0, 0, 3, 0.00, 0, 0, 11, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT5', 'camera-hdtvi-hikvision-ds-2ce16c0t-it5', '- Camera thân HD720P lắp đặt trên trần, phù hợp lắp cho gia đình, văn phòng, shop, nhà xưởng.\r\n- Cảm biến ảnh: 1MP CMOS Image Sensor \r\n- Độ phân giải: 1.0 Megapixel \r\n- Ống kính tiêu cự 3.6mm hoặc 6mm, quan sát xa: 80m \r\n- Hỗ trợ tính năng hồng ngoại thông minh (Smart IR). \r\n- Hỗ trợ IP66', '<p><strong>Chi tiết camera HDTVI HIKVISION DS-2CE16C0T-IT5</strong><br />- Cảm biến ảnh: 1MP CMOS Image Sensor<br />- Độ phân giải: 1.0 Megapixel<br />- Tỷ lệ khung hình: 720p@25fps/720p@30fps<br />- Truyền tín hiệu thời gian thực khoảng cách xa, tốc độ nhanh<br />- Độ nhạy sáng 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR<br />- Ống kính tiêu cự 3.6mm hoặc 6mm<br />- Tầm quan sát xa: 80m<br />- Hỗ trợ Day/Night(ICR), DNR<br />- Hỗ trợ tính năng hồng ngoại thông minh (Smart IR).<br />- Hỗ trợ IP66 chống thời tiết xấu<br />- Nguồn: DC12V</p>', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT5', 'CAMERA HDTVI HIKVISION DS-2CE16C0T-IT5', 'sua chua camera quan sat, lap dat camera', '', '', '24 Tháng'),
(8, 0, '', '0.00', 0, '', '2017-05-17 10:18:04', '2017-05-17 10:18:04', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE16C0T-IRP.jpg', 0, 0, 3, 0.00, 0, 0, 10, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HD-TVI HIKVISION DS-2CE16C0T-IRP', 'camera-hd-tvi-hikvision-ds-2ce16c0t-irp', '- Cảm biến 1/3" CMOS Image Sensor \r\n- Độ phân giải 1.0 MP. 1296(H)x732(V), 720p@25fps/720p@30fps \r\n- 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR \r\n- Ống kính 3.6mm, Angle of View: 70.9°(3.6mm) \r\n- Hồng ngoại lên tới 20 mét \r\n- Chuẩn IP66 (vỏ nhựa kín nước)', '<p><strong>Thông số camera HDTVI HIKVISION DS-2CE16C0T-IRP</strong><br />- Cảm biến 1/3" 1MP CMOS Image Sensor<br />- Độ phân giải 1.0 MP, 1296(H)x732(V)<br />- Độ nhạy sáng 0.1 Lux @(F1.2,AGC ON), 0 Lux with IR<br />- Ống kính 3.6mm hoặc 6mm (Đặt hàng 2.8mm), Angle of View: 70.9°(3.6mm), 92°(2.8mm), 56.7°(6mm).<br />- Hồng ngoại thông minh Smart IR, tầm xa hồng ngoại 20m.<br />- Chống nước tiêu chuẩn IP66.( Vỏ nhựa)<br />- Dải nhiệt hoạt động rộng -40 °C - 60 °C (-40 °F - 140 °F) Humidity 90% or less (non-condensing)<br />- Kích thước Φ70×149.5 mm (Φ2.76” ×5.89”)<br />- Nguồn cấp 12VDC - Max 4W<br />- Chưa có Adapter</p>', 'CAMERA HD-TVI HIKVISION DS-2CE16C0T-IRP', 'CAMERA HD-TVI HIKVISION DS-2CE16C0T-IRP', 'sua chua camera, lap dat camera', '', '', '24 Tháng'),
(9, 0, '', '0.00', 0, '', '2017-05-17 10:22:09', '2017-05-17 10:22:09', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'DS-2CE16D7T-IT3.jpg', 0, 0, 3, 0.00, 0, 0, 16, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HD HIKVISION DS-2CE16D7T-IT3', 'camera-hd-hikvision-ds-2ce16d7t-it3', '- Camera Turbo HD với độ phận giải 2.0MP \r\n- Phù hợp lắp đặt ngoài trời \r\n- Tầm xa hồng ngoại SmartIR 40m \r\n- Hỗ trợ chức năng chống ngược sáng tốt, quan sát 24/24 \r\n- Chống nước tiêu chuẩn IP66', '<p><strong>Thông số kỹ thuật camera HDTVI Hikvision DS-2CE16D7T-IT3</strong><br />- Cảm biến ảnh 1/3" Progressive Scan CMOS<br />- Độ phân giải 2MP@ 1920 × 1080<br />- Độ nhạy sáng 0.01 Lux@(F1.2,AGC ON)<br />- Tầm xa hồng ngoại SmartIR 40m<br />- Ống kính f=3.6mm (67.88°) tùy chọn 2.8mm, 6mm<br />- Chống nước tiêu chuẩn IP66<br />- Hỗ trợ BLC, DNR, AGC<br />- Nguồn vào 12 VDC.<br />- Dải nhiệt hoạt động rộng (-40°~60°).<br />- Thiết kế phù hợp lắp đặt ngoài trời<br /><strong>- Màu trắng</strong><br />- Chưa kèm adaptor<br />- Xuất xứ: Trung Quốc<br />- Bảo hành: 24 tháng</p>', 'CAMERA HD HIKVISION DS-2CE16D7T-IT3', 'CAMERA HD HIKVISION DS-2CE16D7T-IT3', 'sua chua camera, lap dat camera quan sat', '', '', '24 Tháng'),
(10, 0, '', '0.00', 0, '', '2017-05-17 11:40:02', '2017-05-17 11:40:02', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'camera-hikvision-ds-2ce16f1t-it-2.jpg', 0, 0, 3, 0.00, 0, 0, 16, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'CAMERA HDTVI HIKVISION DS-2CE16F1T-IT', 'camera-hdtvi-hikvision-ds-2ce16f1t-it', '- Camera thân hồng ngoại, lắp đặt ngoài trời \r\n- Cảm biến ảnh: 3.0 Megapixel Image CMOS \r\n- Độ phân giải 3.0 Megapixel \r\n- Ống kính 2.8/3.6/6mm@F1.2, Tầm xa hồng ngoại lên tới 20m \r\n- Menu OSD điều khiển từ xa, Giảm nhiễu số, Hồng ngoại thông minh (Smart IR)', '<p><strong>Thông số kỹ thuật camera Turbo TVI Hikvision DS-2CE16F1T-IT</strong><br />- Cảm biến CMOS, 3 Megapixel<br />- Cổng ra Analog HD, độ phân giải 3MP<br />- Độ phân giải ghi hình: 1920x1536@18fps<br />- Ống kính: 2.8/3.6/6mm@F1.2<br />- Tự chuyển chế độ ngày đêm<br />- Chống ngược sáng thực (True WDR) 120dB<br />- Chống nhiễu DNR<br />- Hồng ngoại thông minh công nghệ EXIR 20m<br />- Menu điều khiển OSD thông qua cáp đồng trục (HIKVISION-C)<br />- Tiêu chuẩn ngoài trời IP66<br />- Nguồn cấp: 12V DC<br />- Xuất xứ: Trung Quốc<br />- Bảo hành: 24 tháng</p>', 'CAMERA HDTVI HIKVISION DS-2CE16F1T-IT', 'CAMERA HDTVI HIKVISION DS-2CE16F1T-IT', 'sua chua camera quan sat, lap dat camera', '', '', '24 Tháng'),
(11, 0, '', '0.00', 0, '', '2017-05-26 10:25:40', '2017-05-26 11:18:08', 1, 0, 1, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'HITECH__X628-C.jpg', 0, 0, 3, 0.00, 0, 0, 21, '0.0000', 0, 0, 0, 1, '', '', '', '', '', '', '', 'HITECH  X628-C', 'hitech-x628-c', '', '<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>MÁY CHẤM CÔNG VÂN TAY HITECH X628</strong></p>\r\n<p><strong><u>Máy Chấm Công Vân Tay</u></strong></p>\r\n<p><strong><em><u>Tính năng:</u></em></strong></p>\r\n<p>- Tích hợp nhiều dấu vân tay.</p>\r\n<p><strong>- Dung lượng lưu trữ <u>3000</u> dấu vân tay .</strong></p>\r\n<p>- Dung lượng bộ nhớ trong máy 10<strong><u>0.000</u></strong> lần chấm công.</p>\r\n<p>- Sử dụng Chip xử lý intel của mỹ.</p>\r\n<p>- Tốc độ xử lý rất nhanh&lt;1 giây/1 lần chấm công.</p>\r\n<p>- Phát ra giọng nói bằng ngôn ngữ: <strong>Tiếng anh &amp; Tiếng việt.</strong></p>\r\n<p><strong>- Có Password bảo vệ máy, chế độ hẹn giờ tắt máy, Stand by</strong>.</p>\r\n<p>- Kết nối với máy tính qua cổng RS – 232/485, TCP/IP</p>\r\n<p><strong>- DỮ LIỆU QUA MẠNG INTERNET</strong></p>\r\n<p>- Hiển thị tên người sử dụng trên máy khi chấm công</p>\r\n<p><strong><em><u>Ưu điểm: </u></em></strong></p>\r\n<p><strong>- Sử dụng vân tay </strong><strong><em>tiết kiệm chi phí đầu tư</em></strong></p>\r\n<p><strong>- Bảo mật cao: không chấm công dùm được.</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'HITECH  X628-C', 'HITECH  X628-C', 'Máy cham cong', '', '', '12 Tháng');
