(100, 274, 'Front Page Feature', 'Frontpage Slideshow', '<div class="slide_show">[carousel] [carousel_item]\r\n<h1>Helix Framework</h1>\r\n<p>Powerful templates framework to develop Joomla base website faster!</p>\r\n[button type="primary" size="large" link="http://www.joomshaper.com/helix/"]Download Now[/button] <span style="line-height: 1.3em;">[button type="success" size="large" link="http://demo.joomshaper.com/?template=helix_ii"]Live Demo[/button]</span> [/carousel_item] [carousel_item]\r\n<h1>Layout Builder</h1>\r\n<p>JoomShaper brings Layout Builder first time in Joomla! It is one of the unique features introduced in Helix – II which allows anyone to customize the existing theme in any shape or dimensions without having any programming language!</p>\r\n[/carousel_item] [carousel_item]\r\n<h1>Useful Shortcodes</h1>\r\n<p>In Helix - II you can see many useful Shortcodes installed. Now you can add lots of extra features on your website, without having any coding knowledge.</p>\r\n[/carousel_item] [/carousel]</div>', 1, 'feature', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(101, 0, 'Search', '', '', 1, 'search', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_search', 1, 1, '{"label":"","width":"20","text":"","button":"1","button_pos":"right","imagebutton":"","button_text":"","opensearch":"1","opensearch_title":"","set_itemid":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"itemid"}', 0, '*'),
(102, 227, 'The Framework', '', '<p>[icon name="cog" size="64" color="#fff" class="pull-left" /]<span style="line-height: 1.3em;">The Helix Framework is one of the best light and feature rich responsive theme framework developed by JoomShaper, your trusted friend in this world, for an easy accessibility to the way of building Joomla and Wordpress based websites with hundreds of easy tasking features.</span></p>\r\n<p><span style="line-height: 1.3em;">It is so easy to develop and control of Joomla &amp; Wordpress templates for you and your clients. Helix framework will make your experience of creating website much smoother than ever before.</span></p>\r\n<p><span style="line-height: 1.3em;">[button type="primary" size="large" link="http://www.joomshaper.com/helix"][icon name="download-alt" /] Download Now[/button]</span></p>', 1, 'right', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":" highlighted","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
